(function(b){var a={general:0,found:0};$(".post-block").each(function(c,d){if(c<6+a.general){if($(".post-name").text()!=$(d).find(".recent-post-name").text()){$(d).addClass("active")}else{a.general=1}}});$("#load-more").click(function(){if($(this).hasClass("disable")){return false}$(".post-block").filter(":hidden").each(function(c,d){if(c<6+a.found){if($(".post-name").text()!=$(d).find(".recent-post-name").text()){$(d).addClass("active")}else{a.found=1}}})})})(this);